import {getAllStudy} from '../studies';
import studies from '../components/studies/Studies';
function Studies(){
    const studies=getAllStudy();
    return(
        <div>
            <Studies/>
            <ul>
                {studies.map(studies=>
                <li key={studies.titulo}>{studies.institucion}<br></br>{studies.añoInicio}</li>
                    )}
            </ul>
        </div>
    );
}
export default Studies;
